CREATE TABLE health_data
(
    id                                BIGINT NOT NULL,
    created_at                        TIMESTAMP WITHOUT TIME ZONE,
    modified_at                       TIMESTAMP WITHOUT TIME ZONE,
    is_deleted                        BOOLEAN,
    location_name                     VARCHAR(255),
    event_date                        date,
    age                               DOUBLE PRECISION,
    gender                            VARCHAR(255),
    religion                          VARCHAR(255),
    height_in_inch                    DOUBLE PRECISION,
    weight_in_kg                      DOUBLE PRECISION,
    blood_sugar_in_milli_mole_per_l   DOUBLE PRECISION,
    physical_activity                 VARCHAR(255),
    carb_intake_frequency             VARCHAR(255),
    cereal_quality                    VARCHAR(255),
    blood_pressure_systolic_in_mm_hg  DOUBLE PRECISION,
    blood_pressure_diastolic_in_mm_hg DOUBLE PRECISION,
    CONSTRAINT pk_health_data PRIMARY KEY (id)
);


